フェンダーモールに新ラインナップ　出幅　9mm　ホワイトが追加となりました。<br>
取付方法は、従来のフェンダー折り返し取り付けから、
ボディサイドへ直接強力両面テープで貼り付けるだけ。<br>
殆どの車種に簡単に取り付け可能！<br>
カッターナイフで簡単に切ることが出来ます！<br><br>

商品名:9mmフェンダーモール<br>
カラー:ホワイト<br>
材質：PVC
長さ:1m50cm<br>
本数:2本入り<br>
付属:3M両面テープ<br><br>

※全体の高さは約15mmです。<br>
　全体の横幅は12mmですが出幅は9mmになります。<br><br>

